import "./menuEquipoTrabajo.css"
//import imagenUsuario from '../imagenes/usuario.png';
import { NavLink, useNavigate } from "react-router-dom";


function MenuEquipoTrabajo(){

  const navigate = useNavigate(); 

  function Volver (){
    navigate('/MenuPrincipal');

  }

  function funcionRegistrarEquipo (){
    navigate('/RegisEditEquipo');

  }
  function funcionEditarEquipo (){
    navigate('/BuscarEquipoTrabajo');

  }

  //style={{backgroundImage: `url(${imagenUsuario})`, backgroundSize: 'cover', backgroundRepeat: 'no-repeat'}}

  return(
    <div>
      <label className="barraMenuEquipoTrabajo" style={{position: 'absolute', width: 1750 , height: 125,left: 0,top: 0,color: '#ffff',background: '#468480', }}> </label>
      <label className="nombreUsuarioMenuEquipoTrabajo"> Nombre Usuario </label>

      <button className="botonPersonaMenuEquipoTrabajo" >  </button>
      <button onClick={funcionRegistrarEquipo} className="botonRegistrarEquipoMenuEquipoTrabajo" style={{position: 'absolute', width: 350 , height: 75,left: 500,top:220,border :20,color: '#ffff',background: '#468480' }}> Registrar Equipo de Trabajo </button>
      <button onClick={funcionEditarEquipo} className="botonEditarEquipoMenuEquipoTrabajo" style={{position: 'absolute', width: 350 , height: 75,left: 500,top:380,border :20,color: '#ffff',background: '#468480' }}> Editar Equipo de Trabajo</button>
      <button onClick={Volver} className="botonVolverMenuEquipoTrabajo"> Volver </button>
    </div>
  )
}

export default MenuEquipoTrabajo;
